import { Stack, TextField } from '@mui/material';

export const MuiTextField = () => {
   const styles = theme => ({
      textField: {
          width: '90%',
          marginLeft: 'auto',
          marginRight: 'auto',            
          paddingBottom: 0,
          marginTop: 0,
          fontWeight: 500
      },
      input: {
          color: 'white'
      }
  });
   return (
      <TextField
         id="outlined-basic"
         className={classes.textField}
         variant="outlined"
         fullWidth
         label="Search"
      />
   )
}
